import React, { Component } from "react";
import dateFormat from 'dateformat';
import UserService from "../../services/user-service.jsx"
import { Card, CardBody, Button, Row, Col, Table, Modal, ModalHeader, ModalBody, ModalFooter, Form, FormGroup, Label, Input, InputGroup, InputGroupAddon } from 'reactstrap';

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [],
      message: '',
      beer: '',
      modal: false
    };
  }

  onChange = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  }

  componentDidMount() {
  }

  toggle = () => {
    this.setState(prevState => ({
      modal: !prevState.modal
    }));
  }


  render() {
    return (
      <div className="container" style={{ height: '90vh', marginTop: '30px' }}>
        <Row>
          <Col sm={12}>
            <Card>
              <CardBody>
                <Row>
                </Row>
              </CardBody>
            </Card>
          </Col>
          </Row>
      </div>
    );
  }
}

export default Dashboard;
